import React, { useEffect, useState } from 'react';
import { dbService, firebaseInstance, storageService } from '../fbase';

function Partner() {
    // partner 정보 받아오기
    function Info() {
        const [info, setInfo] = useState();
        const getInfo = async () =>{
            const dbinfo = await dbService.collection("partner").get();
            dbinfo.forEach((document) => {
                const newInfo = {
                    ...document.data(),
                    id: document.id
                };
                setInfo(newInfo)
            });
        };
        useEffect(()=>{
            getInfo();  
        }, [])

    return (
        <div>Partner</div>
    )
}
}

export default Partner;
